import React from 'react';
import logo from './logo.svg';
import './App.css';
import './home.css';

function App() {
  return (
    <div className="App">

        <nav>
          <div className="container">
            <ul className="navbar-left">
              <li><a href="#">Home</a></li>
              <li><a href="#about">About</a></li>
            </ul> 

            <ul class="navbar-right">
              <li><a href="#" id="cart"><i class="fa fa-shopping-cart"></i> Cart <span className="badge">3</span></a></li>
            </ul> 
          </div> 
        </nav>



    </div>
  );
}

export default App;
